INSERT INTO `ws_contenido_traduc` (`id`, `definicion`, `grupo_pregs_id`, `idioma_id`, `traducido`, `deleted_by`, `deleted_at`, `created_at`, `updated_at`) VALUES
(1, 'La pangea hace referencia al momento en que todos los continentes estaban unidos en una única y solo masa, bañados por el mar de Tetis. Al pasar miles de años por efecto de la deriva continental estos continentes se desplazaron hasta ser como hoy los conocemos.', 1, 1, 0, NULL, NULL, '2016-08-17 12:28:07', '2016-08-17 12:29:40'),
(2, 'Contenido 1', 1, 2, 0, NULL, NULL, '2016-08-17 12:28:07', '2016-08-17 12:28:07'),
(3, 'Contenido 1', 1, 3, 0, NULL, NULL, '2016-08-17 12:28:07', '2016-08-17 12:28:07'),
(4, 'Contenido 1', 1, 4, 0, NULL, NULL, '2016-08-17 12:28:07', '2016-08-17 12:28:07'),
(5, '<h3>Cuento del tonto que comió pollo <img src="http://0.0.0.0/wissenLaravel/public/images/perfil/user_1/El_tonton_que_comio_pollo.jpg"/></h3><p>Había una vez tres hermanos. El mayor y el segundo estaban bien, y el tercero era un tonto.Tenían un pollo, pero siempre que hablaban de matar al pollo decían que no le iban a dar ningún pedazo al tonto por tonto. Llegó el día que mataron al pollo y los hermanos que estaban bien ya tenían un plan para no darle nada al tonto. Lo prepararon y lo dejaron listo para meterlo al horno y llamaron al tonto, y ya reunidos los tres le dijeron al tonto: “El que sueñe un bonito sueño se come el pollo”. “Bueno”, dijo el tonto.Metieron el pollo dentro del horno y se fueron a dormir. Pasó un buen rato y cuando los dos hermanos ya estaban bien dormidos el tonto se levantó y fue a la cocina y se comió el pollo; terminó y se fue a dormir.Al otro día temprano se levantaron y el mayor dijo: “Vamos a hablar del sueño que tuvimos anoche. Yo voy a empezar. Pues yo anoche fui a la Gloria y vi al Señor.” “Sí –dijo el otro hermano-, yo vi cuando te ibas volando, me agarré de la manga de tu camisa y nos fuimos los dos.” “Sí –contestó el tonto–, yo vi cuando se iban, y como pensé que ya no iban a regresar fui a la cocina y me comí el pollo; sólo quedaron dos huesitos para que los chupen.”Joaquín Martínez Mendoza, “Cuento del tonto que comió pollo” en Las narraciones de niños y niñas indígenas. México, SEP-Dirección General de Educación Indígena, 2001.</p>', 2, 1, 0, NULL, NULL, '2016-08-17 12:48:56', '2016-08-17 21:02:00'),
(6, 'Contenido 2', 2, 2, 0, NULL, NULL, '2016-08-17 12:48:56', '2016-08-17 12:48:56'),
(7, 'Contenido 2', 2, 3, 0, NULL, NULL, '2016-08-17 12:48:56', '2016-08-17 12:48:56'),
(8, 'Contenido 2', 2, 4, 0, NULL, NULL, '2016-08-17 12:48:56', '2016-08-17 12:48:56'),
(9, '<h4>BARRY, EL FAMOSO SAN BERNARDO </h4><p><img src="http://0.0.0.0/wissenLaravel/public/images/perfil/user_1/sanbernardo.jpeg"/><br/></p><p>Barry es el perro San Bernardo más famoso de la historia, vivió en los años 1800 y 1812 en el hospicio de San Bernardo, en el paso del mismo nombre en Suiza. Siempre se destacó por ayudar a los monjes del hospicio a auxiliar viajeros y peregrinos atrapados o perdidas en la nieve. Barry tenía muy buen desenvolvimiento en la nieve y muy buen sentido de orientación.Su fama se acrecienta con una leyenda que surgió por esa época, aunque se ha dicho que no es cierta, pero igual se conoce hasta nuestros días. Esa leyenda se ha reproducido en múltiples libro y revistas incluso está escrita en un monumento de Barry.La leyenda habla del rescate heroico que Barry efectuó en la nieve de 40 viajeros perdidos en la nieve, Barry los rescató a todos uno por uno, pero al rescatar el último el 41, éste asustado lo confundió con un lobo y lo mató.Pero la verdad es que un monje llevó a Barry en el año 1812 a la ciudad de Berna para que viva mejor sus últimos años, ya que estaba entrado en años y en el año 1814 muere. Su cuerpo fue embalsamado y se encuentra expuesto en la entrada del Museo de Historia Natural de Berna, Suiza.En la localidad de Asnière cerca de Paris, en Francia hay un monumento que eterniza a Barry, al pie tiene la siguiente inscripción en francés por supuesto, “El salvó la vida de 40 personas, fue muerto por la 41″.</p>', 3, 1, 0, NULL, NULL, '2016-08-17 12:55:43', '2016-08-17 21:06:10'),
(10, 'Contenido 3', 3, 2, 0, NULL, NULL, '2016-08-17 12:55:43', '2016-08-17 12:55:43'),
(11, 'Contenido 3', 3, 3, 0, NULL, NULL, '2016-08-17 12:55:43', '2016-08-17 12:55:43'),
(12, 'Contenido 3', 3, 4, 0, NULL, NULL, '2016-08-17 12:55:43', '2016-08-17 12:55:43'),
(13, 'Cierta pareja de individuos sanos desea tener un hijo, pero están preocupados por la posibilidad de que éste al nacer, sufra cierta enfermedad genética de tipo recesivo presente en la familia.', 4, 1, 0, NULL, NULL, '2016-08-17 13:20:26', '2016-08-17 13:20:35'),
(14, 'Contenido 4', 4, 2, 0, NULL, NULL, '2016-08-17 13:20:26', '2016-08-17 13:20:26'),
(15, 'Contenido 4', 4, 3, 0, NULL, NULL, '2016-08-17 13:20:26', '2016-08-17 13:20:26'),
(16, 'Contenido 4', 4, 4, 0, NULL, NULL, '2016-08-17 13:20:26', '2016-08-17 13:20:26'),
(17, 'Eleanor Roosevelt, wife of U.S. President Franklin Delano Roosevelt, is definitely a woman whose achievements were neglected by historians for a long time. She was the first woman to speak in front of a national convention, to write a syndicated column, to earn money as a lecturer, to be a radio commentator, and to hold regular press conferences. Some say she even ran the country during the last year of her husband''s presidency, when he was sick and near death. Recently, historians began to recognize this amazing woman''s achievements, not only as First Lady, but as a political leader and outspoken civil rights advocate in her own right.', 5, 1, 0, NULL, NULL, '2016-08-17 13:45:18', '2016-08-17 13:45:31'),
