(2549, '<p><span style="color: black;">En el quinto día</span><br/></p>', 2466, NULL, 0, 0, 1, '2016-12-08 23:51:08', '2016-12-08 23:53:43'),
(2550, '<p></p><p><span class="apple-converted-space"><span style="color: black;">En el cuarto día</span></span><span class="apple-converted-space"></span></p><p></p>', 2466, NULL, 1, 1, 1, '2016-12-08 23:52:09', '2016-12-08 23:53:43'),
(2551, '<p></p><p><span class="apple-converted-space"><span style="color: black;">En el sexto día.</span></span><span class="apple-converted-space"><u></u></span></p><p></p>', 2466, NULL, 2, 0, 1, '2016-12-08 23:52:21', '2016-12-08 23:53:43'),
(2552, '<p></p><p><span class="apple-converted-space"><span style="color: black;">En el tercer día </span></span><span class="apple-converted-space"></span></p><p></p>', 2466, NULL, 3, 0, 1, '2016-12-08 23:52:35', '2016-12-08 23:53:43'),
(2553, '<p>La Reconciliación “porque Dios estaba en Cristo reconciliando consigo al mundo, sin tomar en cuenta el pecado de los hombres. y nos encargó a nosotros la palabra de la reconciliación” </p>', 2467, NULL, 0, 1, 1, '2016-12-08 23:54:23', '2016-12-09 18:49:12'),
(2554, '<p>La tranquilidad, &#34;Tú guardarás en completa paz a aquel cuyo pensamiento en ti persevera, porque en ti ha confiado&#34;.</p>', 2467, NULL, 1, 0, 1, '2016-12-08 23:55:14', '2016-12-09 18:49:12'),
(2555, '<p>La protección, &#34;No te sobrevendrá mal, ni plaga tocará tu morada&#34;.</p>', 2467, NULL, 2, 0, 1, '2016-12-08 23:55:30', '2016-12-09 18:48:36'),
(2558, '<p>La tierra nueva, &#34;Enjugará Dios toda lágrima de los ojos de ellos; y ya no habrá muerte, ni habrá más llanto, ni clamor, ni dolor; porque las primeras cosas pasaron”.</p>', 2467, NULL, 3, 0, 1, '2016-12-09 18:46:18', '2016-12-09 18:48:36'),
(2559, '<p>El Espíritu Santo inspiró a los escritores de la palabra de Dios.</p>', 2468, NULL, 0, 0, 1, '2016-12-09 19:28:07', '2016-12-09 19:30:26'),
(2560, '<p>Participó en la encarnación de Jesús</p>', 2468, NULL, 1, 0, 1, '2016-12-09 19:28:15', '2016-12-09 19:29:32'),
(2561, '<p></p><p><span class="apple-converted-space"><span>Obra en la transformación del ser humano </span></span></p><p></p>', 2468, NULL, 2, 0, 1, '2016-12-09 19:29:12', '2016-12-09 19:29:32'),
(2562, '<p>Registra nuestros pecados en los libros del cielo</p>', 2468, NULL, 3, 1, 1, '2016-12-09 19:29:20', '2016-12-09 19:30:26'),
(2563, '<p></p><p><span class="apple-converted-space"><span style="color: black;">El Padre porque Él envió a su hijo</span></span><span style="color: black;"></span></p><p></p>', 2469, NULL, 0, 0, 1, '2016-12-09 19:32:50', '2016-12-09 19:34:09'),
(2564, '<p></p><p><span class="apple-converted-space"><span style="color: black;">Cristo reconcilió al mundo con Dios.</span></span><span class="apple-converted-space"><u></u></span></p><p></p>', 2469, NULL, 1, 1, 1, '2016-12-09 19:33:24', '2016-12-09 19:34:09'),
(2565, '<p></p><p><span class="apple-converted-space"><span style="color: black;">El Espíritu Santo quien ha sido enviado para tocar el corazón humano</span></span><span class="apple-converted-space"></span></p><p></p>', 2469, NULL, 2, 0, 1, '2016-12-09 19:33:36', '2016-12-09 19:34:09'),
(2566, '<p></p><p><span class="apple-converted-space"><span style="color: black;">Los ángeles que son enviados para cuidarnos y protegernos</span></span><span class="apple-converted-space"></span></p><p></p>', 2469, NULL, 3, 0, 1, '2016-12-09 19:33:47', '2016-12-09 19:34:09'),
(2567, '<p></p><p><span class="apple-converted-space"><span style="color: windowtext;">Esforzándonos “</span></span><span class="apple-converted-space"><span style="color: black;">Esforzaos y cobrad ánimo; no temáis, ni tengáis miedo de ellos, porque Jehová tu Dios es el que va contigo; no te dejará, ni te desamparará&#34;</span></span></p><p></p>', 2470, NULL, 0, 0, 1, '2016-12-09 19:34:25', '2016-12-09 19:40:10'),
(2568, '<p></p><p><span class="apple-converted-space"><span style="color: black;">Con la muerte al yo y al pecado. “os aseguro que si el grano de trigo no cae y muere, queda solo. pero al morir lleva mucho fruto” </span></span><span class="apple-converted-space"><u></u></span></p><p></p>', 2470, NULL, 1, 1, 1, '2016-12-09 19:34:55', '2016-12-09 19:40:10'),
(2569, '<p></p><p><span class="apple-converted-space"><span style="color: windowtext;">Humillándonos “Humillaos, pues bajo la poderosa mano de Dios, para que Él os exalte cuando fuere tiempo</span></span><span class="apple-converted-space"><span style="color: windowtext;"></span></span></p><p></p>', 2470, NULL, 2, 0, 1, '2016-12-09 19:35:55', '2016-12-09 19:40:10'),
(2570, '<p></p><p><span class="apple-converted-space"><span style="color: windowtext;">Bautizándonos, “Lávame más y más de mi maldad, y límpiame de mi pecado.</span></span><span class="apple-converted-space"><span style="color: windowtext;"></span></span></p><p></p>', 2470, NULL, 3, 0, 1, '2016-12-09 19:35:57', '2016-12-09 19:40:10'),
(2571, '<p></p><p><span class="apple-converted-space"><span style="color: black;">Los justos para que el universo vea que si se logró el objetivo de Cristo</span></span><span class="apple-converted-space"></span></p><p></p>', 2471, NULL, 0, 0, 1, '2016-12-09 19:41:07', '2016-12-10 11:27:36'),
(2572, '<p><span class="apple-converted-space"><span style="color: black;">Los malos para que los justos vean que hubo oportunidades para ellos</span></span><span class="apple-converted-space"></span></p><p></p>', 2471, NULL, 1, 0, 1, '2016-12-09 19:41:18', '2016-12-10 11:27:36'),
(2573, '<p></p><p><span class="apple-converted-space"><span style="color: black;">Todos debemos comparecer para que cada uno reciba según lo que haya hecho, sea bueno o sea malo.</span></span><span class="apple-converted-space"><u></u></span></p><p></p>', 2471, NULL, 2, 1, 1, '2016-12-09 19:41:26', '2016-12-10 11:27:36'),
(2574, '<p></p><p><span class="apple-converted-space"><span style="color: black;">Solo los vivos porque los muertos  nada saben</span></span><span style="color: black;"></span></p><p></p>', 2471, NULL, 3, 0, 1, '2016-12-10 11:27:26', '2016-12-10 11:27:36'),
(2575, '<p></p><p><span class="apple-converted-space"><span style="color: windowtext;">Son perdonados los pecados</span></span><span class="apple-converted-space"><span style="color: windowtext;"></span></span></p><p></p>', 2472, NULL, 0, 0, 1, '2016-12-10 11:27:50', '2016-12-10 11:28:21'),
(2576, '<p></p><p><span class="apple-converted-space"><span style="color: windowtext;">Confesamos nuestra fe en la muerte y resurrección de Jesucristo.</span></span><span class="apple-converted-space"><u><span style="color: windowtext;"></span></u></span></p><p></p>', 2472, NULL, 1, 1, 1, '2016-12-10 11:27:58', '2016-12-10 11:28:21'),
(2577, '<p></p><p><span class="apple-converted-space"><span style="color: windowtext;">Muerte al pecado</span></span><span class="apple-converted-space"><span style="color: windowtext;"></span></span></p><p></p>', 2472, NULL, 2, 0, 1, '2016-12-10 11:28:05', '2016-12-10 11:28:21'),
(2578, '<p></p><p><span class="apple-converted-space"><span style="color: windowtext;">Recibimos al Padre, al Hijo y al Espíritu Santo </span></span><span class="apple-converted-space"><span style="color: windowtext;"></span></span></p><p></p>', 2472, NULL, 3, 0, 1, '2016-12-10 11:28:17', '2016-12-10 11:28:21'),
(2579, '<p></p><p><span class="apple-converted-space"><span style="color: black;">Porque nos unió a todos en un mismo espíritu</span></span><span class="apple-converted-space"><u></u></span></p><p></p>', 2473, NULL, 0, 1, 1, '2016-12-10 11:29:06', '2016-12-10 11:29:36'),
(2580, '<p></p><p><span class="apple-converted-space"><span style="color: black;">Porque fuimos creados a imagen y semejanza de Él</span></span><span class="apple-converted-space"></span></p><p></p>', 2473, NULL, 1, 0, 1, '2016-12-10 11:29:17', '2016-12-10 11:29:36'),
(2581, '<p></p><p><span class="apple-converted-space"><span style="color: black;">Porque Cristo murió por todos</span></span><span class="apple-converted-space"></span></p><p></p>', 2473, NULL, 2, 0, 1, '2016-12-10 11:29:20', '2016-12-10 11:29:36'),
(2582, '<p></p><p><span class="apple-converted-space"><span style="color: black;">Porque su amor es para todos</span></span><span class="apple-converted-space"></span></p><p></p>', 2473, NULL, 3, 0, 1, '2016-12-10 11:29:26', '2016-12-10 11:29:36'),
(2583, '<p></p><p><span class="apple-converted-space"><span style="color: windowtext;">El Pastor para dirigirla y en ausencia del Pastor el primer anciano</span></span><span class="apple-converted-space"><span style="color: windowtext;"></span></span></p><p></p>', 2474, NULL, 0, 0, 1, '2016-12-10 11:29:49', '2016-12-10 11:30:22'),
(2584, '<p></p><p><span class="apple-converted-space"><span style="color: windowtext;">Los diáconos y diaconisas que ayudan a oficiar</span></span><span class="apple-converted-space"><span style="color: windowtext;"></span></span></p><p></p>', 2474, NULL, 1, 0, 1, '2016-12-10 11:30:00', '2016-12-10 11:30:22');
