(2585, '<p></p><p><span class="apple-converted-space"><span style="color: windowtext;">Solo los que se prepararon para tomarla</span></span><span class="apple-converted-space"><span style="color: windowtext;"></span></span></p><p></p>', 2474, NULL, 2, 0, 1, '2016-12-10 11:30:05', '2016-12-10 11:30:22'),
(2586, '<p></p><p><span class="apple-converted-space"><span style="color: windowtext;">Jesús nuestro salvador </span></span><u><span style="color: windowtext;"></span></u></p><p></p>', 2474, NULL, 3, 1, 1, '2016-12-10 11:30:12', '2016-12-10 11:30:22'),
(2587, '<p></p><p><span class="apple-converted-space"><span style="color: black;">Peleando con el enemigo en el cielo</span></span><span class="apple-converted-space"></span></p><p></p>', 2475, NULL, 0, 0, 1, '2016-12-10 11:30:39', '2016-12-10 11:31:16'),
(2588, '<p></p><p><span class="apple-converted-space"><span style="color: black;">Cuidando a Adán y Eva en el jardín</span></span><span class="apple-converted-space"></span></p><p></p>', 2475, NULL, 1, 0, 1, '2016-12-10 11:30:45', '2016-12-10 11:31:16'),
(2589, '<p></p><p><span class="apple-converted-space"><span style="color: black;">Enviando al Espíritu Santo a la tierra</span></span><span class="apple-converted-space"></span></p><p></p>', 2475, NULL, 2, 0, 1, '2016-12-10 11:30:52', '2016-12-10 11:31:16'),
(2590, '<p></p><p><span class="apple-converted-space"><span style="color: black;">Dándonos a su hijo Unigénito </span></span><span class="apple-converted-space"><u></u></span></p><p></p>', 2475, NULL, 3, 1, 1, '2016-12-10 11:31:08', '2016-12-10 11:31:16'),
(2591, '<p></p><p><span class="apple-converted-space"><span style="color: black;">Comunicarle a los seres humanos el conocimiento necesario para la salvación. </span></span><span class="apple-converted-space"></span></p><p></p>', 2476, NULL, 0, 1, 1, '2016-12-10 11:31:46', '2016-12-10 11:32:22'),
(2592, '<p></p><p><span class="apple-converted-space"><span style="color: black;">Comunicarle a la raza humana los problemas que enfrentó el pueblo de Israel</span></span><span class="apple-converted-space"></span></p><p></p>', 2476, NULL, 1, 0, 1, '2016-12-10 11:31:56', '2016-12-10 11:32:22'),
(2593, '<p></p><p><span class="apple-converted-space"><span style="color: black;">Comunicarle a los seres humanos que tenemos un archienemigo</span></span><span class="apple-converted-space"></span></p><p></p>', 2476, NULL, 2, 0, 1, '2016-12-10 11:32:06', '2016-12-10 11:32:22'),
(2594, '<p></p><p><span class="apple-converted-space"><span style="color: black;">Comunicarle al universo entero el amor de Dios para el planeta tierra.</span></span><span class="apple-converted-space"></span></p><p></p>', 2476, NULL, 3, 0, 1, '2016-12-10 11:32:17', '2016-12-10 11:32:22'),
(2595, '<p></p><p><span class="apple-converted-space"><span style="color: windowtext;">Oírlos con gozo “Hazme oír gozo y alegría, y se recrearán los huesos que has abatido.</span></span></p><p></p>', 2477, NULL, 0, 0, 1, '2016-12-10 11:32:32', '2016-12-10 11:33:08'),
(2596, '<p></p><p><span class="apple-converted-space"><span style="color: black;">Tenedlos en mucha estima y amor, por causa de su obra. Vivid en paz entre vosotros”</span></span><span class="apple-converted-space"><span style="color: black;"> </span></span><span class="apple-converted-space"></span></p><p></p>', 2477, NULL, 1, 1, 1, '2016-12-10 11:32:39', '2016-12-10 11:33:08'),
(2597, '<p></p><p><span class="apple-converted-space"><span style="color: black;">Darle fuerzas “El da esfuerzo al cansado, y multiplica las fuerzas al que no tiene ningunas.</span></span><span class="apple-converted-space"></span></p><p></p>', 2477, NULL, 2, 0, 1, '2016-12-10 11:32:46', '2016-12-10 11:33:08'),
(2598, '<p></p><p><span class="apple-converted-space"><span style="color: black;">Brindarle confianza “Dios es nuestro amparo y fortaleza, nuestro pronto auxilio en las tribulaciones</span></span><span class="apple-converted-space"></span></p><p></p>', 2477, NULL, 3, 0, 1, '2016-12-10 11:33:04', '2016-12-10 11:33:08'),
