(265, '<p>La Revolución mexicana fue un conflicto armado, iniciado el 20 de noviembre de 1910 con un levantamiento encabezado por Francisco I. Madero contra el presidente Porfirio Díaz. Se caracterizó por varios movimientos socialistas, liberales, anarquistas, populistas y agrarios. Aunque en principio era una lucha contra el orden establecido, con el tiempo se transformó en una guerra civil; suele ser considerada como el acontecimiento político y social más importante del siglo XX en México. Los aportes políticos, económicos, culturales y sociales que hizo la revolución mexicana a Latinoamérica son invaluables. Una de las reformas que llevó a acabo esta revolución, que se convirtió en modelo para los países latinoamericanos fue</p>', '', 67, 1, NULL, NULL, NULL, 0, NULL, '2016-08-17 13:24:21', '2016-08-17 13:32:02'),
